import { IconButton, List, ListItemButton } from "@mui/material";
import DashboardIcon from '@mui/icons-material/Dashboard';

export default function SidebarAccordian(){


return(
    <>
    <List>
        <ListItemButton sx={{display:"flex"}}><IconButton><DashboardIcon/> </IconButton> Dashboard   </ListItemButton>
    </List>
    </>
)

}
